script: |
  super -f text -I q13604.spq | sort > q13604.out

inputs:
  - name: q13604.spq
    data: |
      SELECT - - col0 AS col2 FROM tab2 (FORMAT parquet) WHERE - col1 BETWEEN + col0 * - ( 3 ) AND - 69 - col2 OR NULL IS NULL;
  - name: tab2

outputs:
  - name: q13604.out
    data: |
      46
      64
      75
